var app = require('express')();
var server = require('http').Server(app);
var io = require('socket.io').listen(5555);
var bodyParser = require('body-parser');
var dgram = require('dgram');

app.use(bodyParser.json());

app.use(function(req, res, next) {
    res.header("Access-Control-Allow-Origin", "*");
    res.header("Access-Control-Allow-Headers", "Origin, X-Requested-With, Content-Type, Accept");
    next();
});

var status = 'off';

app.post('/on', function (req, res) {
    status = 'play';
    io.emit('on');
    res.send({state: true});
});

app.post('/off', function (req, res) {
    status = 'off';
    io.emit('stop');
    res.send({state: false});
});

app.post('/muse', function (req, res) {
    io.emit('muse');
    res.send({state: true});
});

app.post('/taylorswift', function (req, res) {
    io.emit('taylor swift');
    res.send({state: true});
});

app.post('/parkwaydrive', function (req, res) {
    io.emit('parkway drive');
    res.send({state: true});
});

app.post('/next', function (req, res) {
    io.emit('next');
    res.send({state: true});
});

app.post('/previous', function (req, res) {
    io.emit('previous');
    res.send({state: true});
});

app.post('/pause', function (req, res) {
    io.emit('pause');
    res.send({state: false});
});

io.on('connection', function (socket) {
    console.log('Connection!');
});

function broadcastUDPPacket() {
    var broadcastObject = {
        type: 'SOK',
        version: '0.0.1'
    };

    //var broadcastAddress = "0.0.0.0";
    var broadcastAddress = "255.255.255.255";
    var message = new Buffer(JSON.stringify(broadcastObject));
    var client = dgram.createSocket("udp4");
    client.bind();
    client.on("listening", function () {
        client.setBroadcast(true);
        client.send(message, 0, message.length, 3221, broadcastAddress, function (err, bytes) {
            client.close();
        });
    });
}

broadcastUDPPacket();


